int_rules_8_2 = @theory begin

    #= ::Subsection::Closed:: =#
    #= 8.2*Fresnel*integral*functions =#
    @apply_utils Antiderivative(FresnelS(~(a') + ~(b') * ~x), ~x) => ((~a + ~b * ~x) * FresnelS(~a + ~b * ~x)) / ~b + cos((pi / 2) * (~a + ~b * ~x) ^ 2) / (~b * pi) <-- FreeQ([~a, ~b], ~x)
    @apply_utils Antiderivative(FresnelC(~(a') + ~(b') * ~x), ~x) => ((~a + ~b * ~x) * FresnelC(~a + ~b * ~x)) / ~b - sin((pi / 2) * (~a + ~b * ~x) ^ 2) / (~b * pi) <-- FreeQ([~a, ~b], ~x)
    @apply_utils Antiderivative(FresnelS(~(a') + ~(b') * ~x) ^ 2, ~x) => ((~a + ~b * ~x) * FresnelS(~a + ~b * ~x) ^ 2) / ~b - 2 * Antiderivative((~a + ~b * ~x) * sin((pi / 2) * (~a + ~b * ~x) ^ 2) * FresnelS(~a + ~b * ~x), ~x) <-- FreeQ([~a, ~b], ~x)
    @apply_utils Antiderivative(FresnelC(~(a') + ~(b') * ~x) ^ 2, ~x) => ((~a + ~b * ~x) * FresnelC(~a + ~b * ~x) ^ 2) / ~b - 2 * Antiderivative((~a + ~b * ~x) * cos((pi / 2) * (~a + ~b * ~x) ^ 2) * FresnelC(~a + ~b * ~x), ~x) <-- FreeQ([~a, ~b], ~x)
    @apply_utils Antiderivative(FresnelS(~(a') + ~(b') * ~x) ^ ~n, ~x) => Unintegrable(FresnelS(~a + ~b * ~x) ^ ~n, ~x) <-- FreeQ([~a, ~b, ~n], ~x) && (NeQ(~n, 1) && NeQ(~n, 2))
    @apply_utils Antiderivative(FresnelC(~(a') + ~(b') * ~x) ^ ~n, ~x) => Unintegrable(FresnelC(~a + ~b * ~x) ^ ~n, ~x) <-- FreeQ([~a, ~b, ~n], ~x) && (NeQ(~n, 1) && NeQ(~n, 2))
    @apply_utils Antiderivative(FresnelS(~(b') * ~x) / ~x, ~x) => ((1 + im) / 4) * Antiderivative(erf((sqrt(pi) / 2) * (1 + im) * ~b * ~x) / ~x, ~x) + ((1 - im) / 4) * Antiderivative(erf((sqrt(pi) / 2) * (1 - im) * ~b * ~x) / ~x, ~x) <-- FreeQ(~b, ~x)
    @apply_utils Antiderivative(FresnelC(~(b') * ~x) / ~x, ~x) => ((1 - im) / 4) * Antiderivative(erf((sqrt(pi) / 2) * (1 + im) * ~b * ~x) / ~x, ~x) + ((1 + im) / 4) * Antiderivative(erf((sqrt(pi) / 2) * (1 - im) * ~b * ~x) / ~x, ~x) <-- FreeQ(~b, ~x)
    @apply_utils Antiderivative((~(d') * ~x) ^ ~(m') * FresnelS(~(b') * ~x), ~x) => ((~d * ~x) ^ (~m + 1) * FresnelS(~b * ~x)) / (~d * (~m + 1)) - (~b / (~d * (~m + 1))) * Antiderivative((~d * ~x) ^ (~m + 1) * sin((pi / 2) * (~b) ^ 2 * (~x) ^ 2), ~x) <-- FreeQ([~b, ~d, ~m], ~x) && NeQ(~m, -1)
    @apply_utils Antiderivative((~(d') * ~x) ^ ~(m') * FresnelC(~(b') * ~x), ~x) => ((~d * ~x) ^ (~m + 1) * FresnelC(~b * ~x)) / (~d * (~m + 1)) - (~b / (~d * (~m + 1))) * Antiderivative((~d * ~x) ^ (~m + 1) * cos((pi / 2) * (~b) ^ 2 * (~x) ^ 2), ~x) <-- FreeQ([~b, ~d, ~m], ~x) && NeQ(~m, -1)
    @apply_utils Antiderivative((~(c') + ~(d') * ~x) ^ ~(m') * FresnelS(~(a') + ~(b') * ~x), ~x) => ((~c + ~d * ~x) ^ (~m + 1) * FresnelS(~a + ~b * ~x)) / (~d * (~m + 1)) - (~b / (~d * (~m + 1))) * Antiderivative((~c + ~d * ~x) ^ (~m + 1) * sin((pi / 2) * (~a + ~b * ~x) ^ 2), ~x) <-- FreeQ([~a, ~b, ~c, ~d], ~x) && IGtQ(~m, 0)
    @apply_utils Antiderivative((~(c') + ~(d') * ~x) ^ ~(m') * FresnelC(~(a') + ~(b') * ~x), ~x) => ((~c + ~d * ~x) ^ (~m + 1) * FresnelC(~a + ~b * ~x)) / (~d * (~m + 1)) - (~b / (~d * (~m + 1))) * Antiderivative((~c + ~d * ~x) ^ (~m + 1) * cos((pi / 2) * (~a + ~b * ~x) ^ 2), ~x) <-- FreeQ([~a, ~b, ~c, ~d], ~x) && IGtQ(~m, 0)
    @apply_utils Antiderivative((~x) ^ ~(m') * FresnelS(~(b') * ~x) ^ 2, ~x) => ((~x) ^ (~m + 1) * FresnelS(~b * ~x) ^ 2) / (~m + 1) - ((2 * ~b) / (~m + 1)) * Antiderivative((~x) ^ (~m + 1) * sin((pi / 2) * (~b) ^ 2 * (~x) ^ 2) * FresnelS(~b * ~x), ~x) <-- FreeQ(~b, ~x) && (IntegerQ(~m) && NeQ(~m, -1))
    @apply_utils Antiderivative((~x) ^ ~(m') * FresnelC(~(b') * ~x) ^ 2, ~x) => ((~x) ^ (~m + 1) * FresnelC(~b * ~x) ^ 2) / (~m + 1) - ((2 * ~b) / (~m + 1)) * Antiderivative((~x) ^ (~m + 1) * cos((pi / 2) * (~b) ^ 2 * (~x) ^ 2) * FresnelC(~b * ~x), ~x) <-- FreeQ(~b, ~x) && (IntegerQ(~m) && NeQ(~m, -1))
    @apply_utils Antiderivative((~(c') + ~(d') * ~x) ^ ~(m') * FresnelS(~a + ~(b') * ~x) ^ 2, ~x) => (1 / (~b) ^ (~m + 1)) * Subst(Antiderivative(ExpandIntegrand(FresnelS(~x) ^ 2, ((~b * ~c - ~a * ~d) + ~d * ~x) ^ ~m, ~x), ~x), ~x, ~a + ~b * ~x) <-- FreeQ([~a, ~b, ~c, ~d], ~x) && IGtQ(~m, 0)
    @apply_utils Antiderivative((~(c') + ~(d') * ~x) ^ ~(m') * FresnelC(~a + ~(b') * ~x) ^ 2, ~x) => (1 / (~b) ^ (~m + 1)) * Subst(Antiderivative(ExpandIntegrand(FresnelC(~x) ^ 2, ((~b * ~c - ~a * ~d) + ~d * ~x) ^ ~m, ~x), ~x), ~x, ~a + ~b * ~x) <-- FreeQ([~a, ~b, ~c, ~d], ~x) && IGtQ(~m, 0)
    @apply_utils Antiderivative((~(c') + ~(d') * ~x) ^ ~(m') * FresnelS(~(a') + ~(b') * ~x) ^ ~(n'), ~x) => Unintegrable((~c + ~d * ~x) ^ ~m * FresnelS(~a + ~b * ~x) ^ ~n, ~x) <-- FreeQ([~a, ~b, ~c, ~d, ~m, ~n], ~x)
    @apply_utils Antiderivative((~(c') + ~(d') * ~x) ^ ~(m') * FresnelC(~(a') + ~(b') * ~x) ^ ~(n'), ~x) => Unintegrable((~c + ~d * ~x) ^ ~m * FresnelC(~a + ~b * ~x) ^ ~n, ~x) <-- FreeQ([~a, ~b, ~c, ~d, ~m, ~n], ~x)
    @apply_utils Antiderivative(ℯ ^ (~(c') + ~(d') * (~x) ^ 2) * FresnelS(~(b') * ~x), ~x) => ((1 + im) / 4) * Antiderivative(ℯ ^ (~c + ~d * (~x) ^ 2) * erf((sqrt(pi) / 2) * (1 + im) * ~b * ~x), ~x) + ((1 - im) / 4) * Antiderivative(ℯ ^ (~c + ~d * (~x) ^ 2) * erf((sqrt(pi) / 2) * (1 - im) * ~b * ~x), ~x) <-- FreeQ([~b, ~c, ~d], ~x) && EqQ((~d) ^ 2, (-(pi ^ 2) / 4) * (~b) ^ 4)
    @apply_utils Antiderivative(ℯ ^ (~(c') + ~(d') * (~x) ^ 2) * FresnelC(~(b') * ~x), ~x) => ((1 - im) / 4) * Antiderivative(ℯ ^ (~c + ~d * (~x) ^ 2) * erf((sqrt(pi) / 2) * (1 + im) * ~b * ~x), ~x) + ((1 + im) / 4) * Antiderivative(ℯ ^ (~c + ~d * (~x) ^ 2) * erf((sqrt(pi) / 2) * (1 - im) * ~b * ~x), ~x) <-- FreeQ([~b, ~c, ~d], ~x) && EqQ((~d) ^ 2, (-(pi ^ 2) / 4) * (~b) ^ 4)
    @apply_utils Antiderivative(ℯ ^ (~(c') + ~(d') * (~x) ^ 2) * FresnelS(~(a') + ~(b') * ~x) ^ ~(n'), ~x) => Unintegrable(ℯ ^ (~c + ~d * (~x) ^ 2) * FresnelS(~a + ~b * ~x) ^ ~n, ~x) <-- FreeQ([~a, ~b, ~c, ~d, ~n], ~x)
    @apply_utils Antiderivative(ℯ ^ (~(c') + ~(d') * (~x) ^ 2) * FresnelC(~(a') + ~(b') * ~x) ^ ~(n'), ~x) => Unintegrable(ℯ ^ (~c + ~d * (~x) ^ 2) * FresnelC(~a + ~b * ~x) ^ ~n, ~x) <-- FreeQ([~a, ~b, ~c, ~d, ~n], ~x)
    @apply_utils Antiderivative(sin(~(d') * (~x) ^ 2) * FresnelS(~(b') * ~x) ^ ~(n'), ~x) => ((pi * ~b) / (2 * ~d)) * Subst(Antiderivative((~x) ^ ~n, ~x), ~x, FresnelS(~b * ~x)) <-- FreeQ([~b, ~d, ~n], ~x) && EqQ((~d) ^ 2, (pi ^ 2 / 4) * (~b) ^ 4)
    @apply_utils Antiderivative(cos(~(d') * (~x) ^ 2) * FresnelC(~(b') * ~x) ^ ~(n'), ~x) => ((pi * ~b) / (2 * ~d)) * Subst(Antiderivative((~x) ^ ~n, ~x), ~x, FresnelC(~b * ~x)) <-- FreeQ([~b, ~d, ~n], ~x) && EqQ((~d) ^ 2, (pi ^ 2 / 4) * (~b) ^ 4)
    @apply_utils Antiderivative(sin(~c + ~(d') * (~x) ^ 2) * FresnelS(~(b') * ~x), ~x) => sin(~c) * Antiderivative(cos(~d * (~x) ^ 2) * FresnelS(~b * ~x), ~x) + cos(~c) * Antiderivative(sin(~d * (~x) ^ 2) * FresnelS(~b * ~x), ~x) <-- FreeQ([~b, ~c, ~d], ~x) && EqQ((~d) ^ 2, (pi ^ 2 / 4) * (~b) ^ 4)
    @apply_utils Antiderivative(cos(~c + ~(d') * (~x) ^ 2) * FresnelC(~(b') * ~x), ~x) => cos(~c) * Antiderivative(cos(~d * (~x) ^ 2) * FresnelC(~b * ~x), ~x) - sin(~c) * Antiderivative(sin(~d * (~x) ^ 2) * FresnelC(~b * ~x), ~x) <-- FreeQ([~b, ~c, ~d], ~x) && EqQ((~d) ^ 2, (pi ^ 2 / 4) * (~b) ^ 4)
    @apply_utils Antiderivative(sin(~(c') + ~(d') * (~x) ^ 2) * FresnelS(~(a') + ~(b') * ~x) ^ ~(n'), ~x) => Unintegrable(sin(~c + ~d * (~x) ^ 2) * FresnelS(~a + ~b * ~x) ^ ~n, ~x) <-- FreeQ([~a, ~b, ~c, ~d, ~n], ~x)
    @apply_utils Antiderivative(cos(~(c') + ~(d') * (~x) ^ 2) * FresnelC(~(a') + ~(b') * ~x) ^ ~(n'), ~x) => Unintegrable(cos(~c + ~d * (~x) ^ 2) * FresnelC(~a + ~b * ~x) ^ ~n, ~x) <-- FreeQ([~a, ~b, ~c, ~d, ~n], ~x)
    @apply_utils Antiderivative(cos(~(d') * (~x) ^ 2) * FresnelS(~(b') * ~x), ~x) => ((FresnelC(~b * ~x) * FresnelS(~b * ~x)) / (2 * ~b) - (1 / 8) * im * ~b * (~x) ^ 2 * HypergeometricPFQ([1, 1], [3 / 2, 2], (-1 / 2) * im * (~b) ^ 2 * pi * (~x) ^ 2)) + (1 / 8) * im * ~b * (~x) ^ 2 * HypergeometricPFQ([1, 1], [3 / 2, 2], (1 / 2) * im * (~b) ^ 2 * pi * (~x) ^ 2) <-- FreeQ([~b, ~d], ~x) && EqQ((~d) ^ 2, (pi ^ 2 / 4) * (~b) ^ 4)
    @apply_utils Antiderivative(sin(~(d') * (~x) ^ 2) * FresnelC(~(b') * ~x), ~x) => ((~b * pi * FresnelC(~b * ~x) * FresnelS(~b * ~x)) / (4 * ~d) + (1 / 8) * im * ~b * (~x) ^ 2 * HypergeometricPFQ([1, 1], [3 / 2, 2], -im * ~d * (~x) ^ 2)) - (1 / 8) * im * ~b * (~x) ^ 2 * HypergeometricPFQ([1, 1], [3 / 2, 2], im * ~d * (~x) ^ 2) <-- FreeQ([~b, ~d], ~x) && EqQ((~d) ^ 2, (pi ^ 2 / 4) * (~b) ^ 4)
    @apply_utils Antiderivative(cos(~c + ~(d') * (~x) ^ 2) * FresnelS(~(b') * ~x), ~x) => cos(~c) * Antiderivative(cos(~d * (~x) ^ 2) * FresnelS(~b * ~x), ~x) - sin(~c) * Antiderivative(sin(~d * (~x) ^ 2) * FresnelS(~b * ~x), ~x) <-- FreeQ([~b, ~c, ~d], ~x) && EqQ((~d) ^ 2, (pi ^ 2 / 4) * (~b) ^ 4)
    @apply_utils Antiderivative(sin(~c + ~(d') * (~x) ^ 2) * FresnelC(~(b') * ~x), ~x) => sin(~c) * Antiderivative(cos(~d * (~x) ^ 2) * FresnelC(~b * ~x), ~x) + cos(~c) * Antiderivative(sin(~d * (~x) ^ 2) * FresnelC(~b * ~x), ~x) <-- FreeQ([~b, ~c, ~d], ~x) && EqQ((~d) ^ 2, (pi ^ 2 / 4) * (~b) ^ 4)
    @apply_utils Antiderivative(cos(~(c') + ~(d') * (~x) ^ 2) * FresnelS(~(a') + ~(b') * ~x) ^ ~(n'), ~x) => Unintegrable(cos(~c + ~d * (~x) ^ 2) * FresnelS(~a + ~b * ~x) ^ ~n, ~x) <-- FreeQ([~a, ~b, ~c, ~d, ~n], ~x)
    @apply_utils Antiderivative(sin(~(c') + ~(d') * (~x) ^ 2) * FresnelC(~(a') + ~(b') * ~x) ^ ~(n'), ~x) => Unintegrable(sin(~c + ~d * (~x) ^ 2) * FresnelC(~a + ~b * ~x) ^ ~n, ~x) <-- FreeQ([~a, ~b, ~c, ~d, ~n], ~x)
    @apply_utils Antiderivative(~x * sin(~(d') * (~x) ^ 2) * FresnelS(~(b') * ~x), ~x) => (-(cos(~d * (~x) ^ 2)) * FresnelS(~b * ~x)) / (2 * ~d) + (1 / (2 * ~b * pi)) * Antiderivative(sin(2 * ~d * (~x) ^ 2), ~x) <-- FreeQ([~b, ~d], ~x) && EqQ((~d) ^ 2, (pi ^ 2 / 4) * (~b) ^ 4)
    @apply_utils Antiderivative(~x * cos(~(d') * (~x) ^ 2) * FresnelC(~(b') * ~x), ~x) => (sin(~d * (~x) ^ 2) * FresnelC(~b * ~x)) / (2 * ~d) - (~b / (4 * ~d)) * Antiderivative(sin(2 * ~d * (~x) ^ 2), ~x) <-- FreeQ([~b, ~d], ~x) && EqQ((~d) ^ 2, (pi ^ 2 / 4) * (~b) ^ 4)
    @apply_utils Antiderivative((~x) ^ ~m * sin(~(d') * (~x) ^ 2) * FresnelS(~(b') * ~x), ~x) => (-((~x) ^ (~m - 1)) * cos(~d * (~x) ^ 2) * FresnelS(~b * ~x)) / (2 * ~d) + (1 / (2 * ~b * pi)) * Antiderivative((~x) ^ (~m - 1) * sin(2 * ~d * (~x) ^ 2), ~x) + ((~m - 1) / (2 * ~d)) * Antiderivative((~x) ^ (~m - 2) * cos(~d * (~x) ^ 2) * FresnelS(~b * ~x), ~x) <-- FreeQ([~b, ~d], ~x) && (EqQ((~d) ^ 2, (pi ^ 2 / 4) * (~b) ^ 4) && IGtQ(~m, 1))
    @apply_utils Antiderivative((~x) ^ ~m * cos(~(d') * (~x) ^ 2) * FresnelC(~(b') * ~x), ~x) => (((~x) ^ (~m - 1) * sin(~d * (~x) ^ 2) * FresnelC(~b * ~x)) / (2 * ~d) - (~b / (4 * ~d)) * Antiderivative((~x) ^ (~m - 1) * sin(2 * ~d * (~x) ^ 2), ~x)) - ((~m - 1) / (2 * ~d)) * Antiderivative((~x) ^ (~m - 2) * sin(~d * (~x) ^ 2) * FresnelC(~b * ~x), ~x) <-- FreeQ([~b, ~d], ~x) && (EqQ((~d) ^ 2, (pi ^ 2 / 4) * (~b) ^ 4) && IGtQ(~m, 1))
    @apply_utils Antiderivative((~x) ^ ~m * sin(~(d') * (~x) ^ 2) * FresnelS(~(b') * ~x), ~x) => ((((~x) ^ (~m + 1) * sin(~d * (~x) ^ 2) * FresnelS(~b * ~x)) / (~m + 1) - (~d * (~x) ^ (~m + 2)) / (pi * ~b * (~m + 1) * (~m + 2))) + (~d / (pi * ~b * (~m + 1))) * Antiderivative((~x) ^ (~m + 1) * cos(2 * ~d * (~x) ^ 2), ~x)) - ((2 * ~d) / (~m + 1)) * Antiderivative((~x) ^ (~m + 2) * cos(~d * (~x) ^ 2) * FresnelS(~b * ~x), ~x) <-- FreeQ([~b, ~d], ~x) && (EqQ((~d) ^ 2, (pi ^ 2 / 4) * (~b) ^ 4) && ILtQ(~m, -2))
    @apply_utils Antiderivative((~x) ^ ~m * cos(~(d') * (~x) ^ 2) * FresnelC(~(b') * ~x), ~x) => ((((~x) ^ (~m + 1) * cos(~d * (~x) ^ 2) * FresnelC(~b * ~x)) / (~m + 1) - (~b * (~x) ^ (~m + 2)) / (2 * (~m + 1) * (~m + 2))) - (~b / (2 * (~m + 1))) * Antiderivative((~x) ^ (~m + 1) * cos(2 * ~d * (~x) ^ 2), ~x)) + ((2 * ~d) / (~m + 1)) * Antiderivative((~x) ^ (~m + 2) * sin(~d * (~x) ^ 2) * FresnelC(~b * ~x), ~x) <-- FreeQ([~b, ~d], ~x) && (EqQ((~d) ^ 2, (pi ^ 2 / 4) * (~b) ^ 4) && ILtQ(~m, -2))
    @apply_utils Antiderivative((~(e') * ~x) ^ ~(m') * sin(~(c') + ~(d') * (~x) ^ 2) * FresnelS(~(a') + ~(b') * ~x) ^ ~(n'), ~x) => Unintegrable((~e * ~x) ^ ~m * sin(~c + ~d * (~x) ^ 2) * FresnelS(~a + ~b * ~x) ^ ~n, ~x) <-- FreeQ([~a, ~b, ~c, ~d, ~e, ~m, ~n], ~x)
    @apply_utils Antiderivative((~(e') * ~x) ^ ~(m') * cos(~(c') + ~(d') * (~x) ^ 2) * FresnelC(~(a') + ~(b') * ~x) ^ ~(n'), ~x) => Unintegrable((~e * ~x) ^ ~m * cos(~c + ~d * (~x) ^ 2) * FresnelC(~a + ~b * ~x) ^ ~n, ~x) <-- FreeQ([~a, ~b, ~c, ~d, ~e, ~m, ~n], ~x)
    @apply_utils Antiderivative(~x * cos(~(d') * (~x) ^ 2) * FresnelS(~(b') * ~x), ~x) => (sin(~d * (~x) ^ 2) * FresnelS(~b * ~x)) / (2 * ~d) - (1 / (pi * ~b)) * Antiderivative(sin(~d * (~x) ^ 2) ^ 2, ~x) <-- FreeQ([~b, ~d], ~x) && EqQ((~d) ^ 2, (pi ^ 2 / 4) * (~b) ^ 4)
    @apply_utils Antiderivative(~x * sin(~(d') * (~x) ^ 2) * FresnelC(~(b') * ~x), ~x) => (-(cos(~d * (~x) ^ 2)) * FresnelC(~b * ~x)) / (2 * ~d) + (~b / (2 * ~d)) * Antiderivative(cos(~d * (~x) ^ 2) ^ 2, ~x) <-- FreeQ([~b, ~d], ~x) && EqQ((~d) ^ 2, (pi ^ 2 / 4) * (~b) ^ 4)
    @apply_utils Antiderivative((~x) ^ ~m * cos(~(d') * (~x) ^ 2) * FresnelS(~(b') * ~x), ~x) => (((~x) ^ (~m - 1) * sin(~d * (~x) ^ 2) * FresnelS(~b * ~x)) / (2 * ~d) - (1 / (pi * ~b)) * Antiderivative((~x) ^ (~m - 1) * sin(~d * (~x) ^ 2) ^ 2, ~x)) - ((~m - 1) / (2 * ~d)) * Antiderivative((~x) ^ (~m - 2) * sin(~d * (~x) ^ 2) * FresnelS(~b * ~x), ~x) <-- FreeQ([~b, ~d], ~x) && (EqQ((~d) ^ 2, (pi ^ 2 / 4) * (~b) ^ 4) && IGtQ(~m, 1))
    @apply_utils Antiderivative((~x) ^ ~m * sin(~(d') * (~x) ^ 2) * FresnelC(~(b') * ~x), ~x) => (-((~x) ^ (~m - 1)) * cos(~d * (~x) ^ 2) * FresnelC(~b * ~x)) / (2 * ~d) + (~b / (2 * ~d)) * Antiderivative((~x) ^ (~m - 1) * cos(~d * (~x) ^ 2) ^ 2, ~x) + ((~m - 1) / (2 * ~d)) * Antiderivative((~x) ^ (~m - 2) * cos(~d * (~x) ^ 2) * FresnelC(~b * ~x), ~x) <-- FreeQ([~b, ~d], ~x) && (EqQ((~d) ^ 2, (pi ^ 2 / 4) * (~b) ^ 4) && IGtQ(~m, 1))
    @apply_utils Antiderivative((~x) ^ ~m * cos(~(d') * (~x) ^ 2) * FresnelS(~(b') * ~x), ~x) => (((~x) ^ (~m + 1) * cos(~d * (~x) ^ 2) * FresnelS(~b * ~x)) / (~m + 1) - (~d / (pi * ~b * (~m + 1))) * Antiderivative((~x) ^ (~m + 1) * sin(2 * ~d * (~x) ^ 2), ~x)) + ((2 * ~d) / (~m + 1)) * Antiderivative((~x) ^ (~m + 2) * sin(~d * (~x) ^ 2) * FresnelS(~b * ~x), ~x) <-- FreeQ([~b, ~d], ~x) && (EqQ((~d) ^ 2, (pi ^ 2 / 4) * (~b) ^ 4) && ILtQ(~m, -1))
