    @apply_utils Antiderivative((~(e') * ~x) ^ ~(m') * sin(~(c') + ~(d') * (~x) ^ 2) * FresnelC(~(a') + ~(b') * ~x) ^ ~(n'), ~x) => Unintegrable((~e * ~x) ^ ~m * sin(~c + ~d * (~x) ^ 2) * FresnelC(~a + ~b * ~x) ^ ~n, ~x) <-- FreeQ([~a, ~b, ~c, ~d, ~e, ~m, ~n], ~x)
    @apply_utils Antiderivative(FresnelS(~(d') * (~(a') + ~(b') * log(~(c') * (~x) ^ ~(n')))), ~x) => ~x * FresnelS(~d * (~a + ~b * log(~c * (~x) ^ ~n))) - ~b * ~d * ~n * Antiderivative(sin((pi / 2) * (~d * (~a + ~b * log(~c * (~x) ^ ~n))) ^ 2), ~x) <-- FreeQ([~a, ~b, ~c, ~d, ~n], ~x)
    @apply_utils Antiderivative(FresnelC(~(d') * (~(a') + ~(b') * log(~(c') * (~x) ^ ~(n')))), ~x) => ~x * FresnelC(~d * (~a + ~b * log(~c * (~x) ^ ~n))) - ~b * ~d * ~n * Antiderivative(cos((pi / 2) * (~d * (~a + ~b * log(~c * (~x) ^ ~n))) ^ 2), ~x) <-- FreeQ([~a, ~b, ~c, ~d, ~n], ~x)
    @apply_utils Antiderivative((~F)(~(d') * (~(a') + ~(b') * log(~(c') * (~x) ^ ~(n')))) / ~x, ~x) => (1 / ~n) * Subst((~F)(~d * (~a + ~b * ~x)), ~x, log(~c * (~x) ^ ~n)) <-- FreeQ([~a, ~b, ~c, ~d, ~n], ~x) && MemberQ([FresnelS, FresnelC], ~F)
    @apply_utils Antiderivative((~(e') * ~x) ^ ~(m') * FresnelS(~(d') * (~(a') + ~(b') * log(~(c') * (~x) ^ ~(n')))), ~x) => ((~e * ~x) ^ (~m + 1) * FresnelS(~d * (~a + ~b * log(~c * (~x) ^ ~n)))) / (~e * (~m + 1)) - ((~b * ~d * ~n) / (~m + 1)) * Antiderivative((~e * ~x) ^ ~m * sin((pi / 2) * (~d * (~a + ~b * log(~c * (~x) ^ ~n))) ^ 2), ~x) <-- FreeQ([~a, ~b, ~c, ~d, ~e, ~m, ~n], ~x) && NeQ(~m, -1)
    @apply_utils Antiderivative((~(e') * ~x) ^ ~(m') * FresnelC(~(d') * (~(a') + ~(b') * log(~(c') * (~x) ^ ~(n')))), ~x) => ((~e * ~x) ^ (~m + 1) * FresnelC(~d * (~a + ~b * log(~c * (~x) ^ ~n)))) / (~e * (~m + 1)) - ((~b * ~d * ~n) / (~m + 1)) * Antiderivative((~e * ~x) ^ ~m * cos((pi / 2) * (~d * (~a + ~b * log(~c * (~x) ^ ~n))) ^ 2), ~x) <-- FreeQ([~a, ~b, ~c, ~d, ~e, ~m, ~n], ~x) && NeQ(~m, -1)
end
